import React, {Component} from 'react';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import TextField from '@material-ui/core/TextField';

const container = {
  position: 'absolute', left: '50%', top: '50%',
  transform: 'translate(-50%, -50%)'
}


const card = {
    Width: 500,
    height: 700,
    position: 'absolute', left: '50%', top: '50%',
    transform: 'translate(-50%, -50%)'
};
const title = {
    fontSize: 14,
};
const subtitle = {
    marginBottom: 50,
};
const emailForm = {
  width: 400,
}
const passwordForm = {
  width: 400,
}


export default class Login extends Component {

  render(){
    return (
      <Card style={card}>
        <CardContent>
          <Typography style={title} color="textSecondary" gutterBottom>
          </Typography>
          <Typography variant="h5" component="h2">
            Sign In
          </Typography>
          <Typography style={subtitle} color="textSecondary">
            to your new addiction
          </Typography>
              <form className={emailForm} noValidate autoComplete="off">
                <TextField style={{width: 300, marginBottom: 50}}  id="standard-basic" label="email" color="secondary"/>
              </form>
              <form className={passwordForm} noValidate autoComplete="off">
                <TextField style={{width: 300}}  id="standard-basic" label="password" />
              </form>
              <Button variant="contained" color="secondary">
                Log in
              </Button>

        </CardContent>
        <CardActions>
          <Button size="small">Learn More</Button>
        </CardActions>
      </Card>
    );
  }
}
